import styled from 'styled-components';

export const HeaderContainer = styled.div`
  background: #ECECEC;
  height: 63px;
  margin: 2px;
  font-family: 'Open Sans', sans-serif;
  display: flex;
  align-items: center;
  justify-content: center;
  img{
    max-width: 30px;
    margin-right: 5px;
  }
`;
